description:
Без комісій та комунальних платежів! 
Хостел по вул.Хрещатик завжди відкритий для наших гостей!

Розташований у центрі міста, у районі Майдану Незалежності. Зручне розташування дозволяє дістатися будь-якої точки Києва. ТЦ "ЦУМ", ТЦ "Метроград", Бессарабський ринок, де ви знайдете все! А так само бари, паби та ресторани на будь-який смак!

Ціни Вас приємно здивують: 150грн - за добу; 700грн - за тиждень; 1800грн - за місяць.

Всі зручності: 
-Зроблено якісний ремонт; 
-роздільні санвузли;
-Нові ортопедичні матраци;
-Ліжка з драбинками;
-свіжа постільна білизна;
-Безкоштовний wi-fi;
-Шафки під ключ для цінних речей;
-Зони відпочинку зі зручними диванами;
І багато іншого забезпечить Вам комфортне проживання у нашому хостелі!

Чекаємо на Вас!

Продається одноповерховий комфортний будинок у центральній частині м. Києва (Олександрівська слобідка) площею 156 м². На ділянці розташовано криту терасу, автонавіс та джакузі. 

Площа: 156 м²
Ділянка: 4 сотки
Розташування: м. Київ, Солом’янський р-н

Плануванння:
прихожа з великими шафами для зберігання, гостьовийсанвузол, master-спальня з санвузлом і гардеробом, кухня-вітальня, вихід на терасу засклену, гостьова спальня, дитяча спальна кімната.

У будинку:
- фундамент — армована стрічка зі сваями;
- стіни з газоблоку;
- утеплення екструдована мінеральна вата;
- фасад — декоративна плитка з імітацією цегли;
- дах - металочерепиця з гідро- і паробар’єром, утеплення 25 см вінвата;
- великі вікна —  2- камерні склопакети BEKO;
- телпа водяна підлога в котельні, санвузлах, коридорі та кухні-вітальні;
- електрика — 25 кВт, стабілізатор ;
- вода — централізована з системою очистки та пом’якшення;
- каналізація — центральна міська;
- водовідведення від будинку в каналізацію;
- заведено швидкісний інтернет;
- опалення – газовий котел;
- висота стель – 2, 85 м, оздоблено гіпсокартоном;
- біокамін у вітальні;
- вбудована кухоннна техніка (холодильник LG, духова шафа Bosch, посудомийна машина Siemens, індукційна поверхня).

Біля будинку:
- ділянка 4 сотки;
- засклена тераса;
- джакузі;
- тераса на ділянці крита;
- хозприміщення на ділянці;
- навіс для авто;
- асфальтований під’їзд; 
- встановлено паркан по периметру — металевий профнастил;
- автополив, газон, зелені насадження;
- ворота відкатні з автоматикою.

Будинок знаходиться фактично в центрі міста, район Совки. Відстань до вул. Хрещатик — 5 км. Поруч з будинком знаходяться продуктові супермаркети, медичні установи, салони краси, кав’ярні. Найближча станція метро — Либідська, Палац «Україна».
